BEGIN TRANSACTION;
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "eventApi_attendance" ("attendance_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "attended" bool NOT NULL, "marked_on" datetime NOT NULL, "student_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_calendarsync" ("sync_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "calendar_type" varchar(50) NOT NULL, "sync_timestamp" datetime NOT NULL, "calendar_url" varchar(255) NULL, "student_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_certificate" ("certificate_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "certificate_url" varchar(255) NOT NULL, "issued_on" datetime NOT NULL, "student_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_contactmessage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "first_name" varchar(100) NOT NULL, "last_name" varchar(100) NOT NULL, "email" varchar(254) NOT NULL, "phone" varchar(20) NULL, "subject" varchar(20) NOT NULL, "message" text NOT NULL, "subscribe" bool NOT NULL, "status" varchar(20) NOT NULL, "ip_address" char(39) NULL, "user_agent" text NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "admin_notes" text NULL, "replied_at" datetime NULL, "replied_by_id" bigint NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_event" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(150) NULL, "description" text NULL, "status" varchar(20) NOT NULL, "date" date NOT NULL, "start_time" time NOT NULL, "end_time" time NOT NULL, "image" varchar(100) NULL, "gate_fees" integer NULL, "gate_fees2" integer NULL, "organizer_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "venue_id" bigint NULL REFERENCES "eventApi_venue" ("id") DEFERRABLE INITIALLY DEFERRED, "category" varchar(50) NULL, "created_at" datetime NULL, "max_participants" integer unsigned NOT NULL CHECK ("max_participants" >= 0));
CREATE TABLE "eventApi_eventseating" ("event_id" bigint NOT NULL PRIMARY KEY REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED, "venue_name" varchar(200) NULL, "total_seats" integer unsigned NOT NULL CHECK ("total_seats" >= 0), "seats_booked" integer unsigned NOT NULL CHECK ("seats_booked" >= 0), "waitlist_enabled" bool NOT NULL);
CREATE TABLE "eventApi_eventsharelog" ("share_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "platform" varchar(50) NULL, "share_timestamp" datetime NOT NULL, "share_message" text NULL, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" bigint NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_eventwaitlist" ("waitlist_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "waitlist_time" datetime NOT NULL, "status" varchar(20) NOT NULL, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_feedback" ("feedback_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rating" smallint unsigned NOT NULL CHECK ("rating" >= 0), "comments" text NULL, "submitted_on" datetime NOT NULL, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_mediagallery" ("media_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "file_type" varchar(10) NOT NULL, "caption" varchar(150) NULL, "uploaded_on" datetime NOT NULL, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED, "uploaded_by_id" bigint NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "file" varchar(100) NULL);
CREATE TABLE "eventApi_registration" ("registration_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "registered_on" datetime NOT NULL, "status" varchar(20) NOT NULL, "ticket_type" varchar(10) NOT NULL, "price" integer NULL, "seat_number" varchar(10) NULL, "qr_code" varchar(100) NULL, "is_used" bool NOT NULL, "created_at" datetime NULL, "event_id" bigint NOT NULL REFERENCES "eventApi_event" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "public_id" char(32) NOT NULL UNIQUE, "checked_in_at" datetime NULL, "checked_in_by_id" bigint NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "role" varchar(20) NOT NULL, "mobile" varchar(15) NULL, "department" varchar(100) NULL, "matric_no" varchar(50) NULL UNIQUE);
CREATE TABLE "eventApi_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "eventApi_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "eventApi_venue" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "address" text NOT NULL, "capacity" integer unsigned NULL CHECK ("capacity" >= 0));
